import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

function Home() {
  return (
    <div>
      <h1 style={{ color: 'blue' }}>Halo, TugasKu!</h1>
      <p>Selamat datang di aplikasi manajemen tugas.</p>
    </div>
  );
}

function About() {
  return (
    <div>
      <h2>Tentang Aplikasi</h2>
      <p>Aplikasi ini membantu kamu mengelola tugas harian.</p>
    </div>
  );
}

export default function App() {
  return (
    <Router>
      <nav className="navbar navbar-expand navbar-dark bg-dark px-3">
        <Link className="navbar-brand" to="/">TugasKu</Link>
        <div className="navbar-nav">
          <Link className="nav-link" to="/">Beranda</Link>
          <Link className="nav-link" to="/about">Tentang</Link>
        </div>
      </nav>

      <div className="container mt-4">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
        </Routes>
      </div>
    </Router>
  );
}
